import React from 'react';
import About from './About';
import Footer from './Footer';
import Navbar from './Navbar';

const Home = () => {

      return(
            <>
                  <div style={{height:'72px'}}/>
                  <Navbar/>
                  <div id='About'/>
                  <About/>
                  <div id='Contact'/>
                  <Footer/>
            </>
      )
}

export default Home ;
